import React from 'react';
import AboutColumnOne from './AboutColumnOne';
import AboutColumnTwo from './AboutColumnTwo';

const About = () => {
    return (
        <div id="about">
            <AboutColumnOne id="about1" />
            <AboutColumnTwo id="about2" />
        </div>
    )
}

export default About;
